import axios from "axios";

const KEY = "AIzaSyDutJ6jUbUX7ugpylArGCI0rGr1m-MSNPA";

export default axios.create({
  baseURL: "https://www.googleapis.com/youtube/v3",
  params: {
      part: 'snippet',
      maxResuts:5,
      key: KEY
  }
});
